import React, { Component } from 'react';

class Team extends Component {
    state = { 
        name:'Team',
        gamesPlayed: 0,
        goalDifference: 0,
        points: 0
     }
     constructor(){
         super();

     }
    render() { 
        return ( 
            <ul class="list-group list-group-horizontal">
                <li>{this.state.name}</li>
                <li>{this.state.gamesPlayed}</li>
                <li>{this.state.goalDifference}</li>
                <li>{this.state.points}</li>
            </ul>
         );
    }
}

export default Team;
